(1, '<h3 style="text-align: center;">စည္းမ်ဥ္းစည္းကမ္းခ်က္မ်ား</h3><h4>“စည္းမ်ဥ္းစည္းကမ္းခ်က္မ်ား”ကို ဆိုက္၏ “Terms &amp; Conditons” စာလံုးေပၚတြင္ ႏွိပ္ျခင္းျဖင့္ ၾကည့္ရႈႏိုင္ပါသည္။</h4><h4>- MMWbet ဝန္ေတာင္မူကို အသံုးျပဳေနသူသည္ MMWbet ၏ သတ္မွတ္စည္းကမ္းခ်က္မ်ားကို ဖတ္ရႈၿပီး လက္ခံသည္ဟု MMWbet မွ ယူဆသည္။</h4><h4>- MMWbet ဝန္ေဆာင္မူကို အသံုးျပဳရန္  အသက္ ၁၈ ႏွစ္ျပည့္ၿပီးမွ အသံုးျပဳခြင့္ ရွိသည္။</h4><h4>- MMWbet သည္အခ်ိန္မေရြး စည္းကမ္းခ်က္မ်ားကို ျပဳျပင္ျဖည့္စြတ္ျခင္း ျပဳလုပ္ႏိုင္သည္။ (စည္​းကမ္​းအသစ္​မ်ား ထပ္​တိုးပါက MMWbet ၏ facebook page www.facebook.com/MMWbet သို႔မဟုတ္​ အီး​ေမးလ္​ျဖင္​့ အသိ​ေပး​ေၾကျငာ​ေပးပါမည္​​)</h4><h4>- MMWbet ဝန္ေဆာင္မူကို အသံုးျပဳစဥ္ အသံုးျပဳသူ၏ အမွား၊ေပါ႔ေလ်ာ့မူ႔ (eg. ဆန္႔က်င္ဘက္မွားေရြးမိျခင္း ၊ ေငြ amount ပိုယူမိျခင္း ေလ်ာ့ယူမိျခင္း ၊ ေငြလႊဲေငြေျပာင္းရာတြင္ မွားပို႔မိျခင္း ၊ အေကာင့္တစ္ခုအား ႏွစ္ဦးအသံုးျပဳျခင္း)သည္ အသံုးျပဳသူ၏ တာဝန္သာျဖစ္သည္။</h4><h4>- အသံုးျပဳသူအေကာင့္သည္ လိမ္ညာေႏွာင့္ယွက္ေနသူဟု mmwbet မွ ယူဆပါက အသံုးျပဳသူ အေကာင့္အား ယာယီ (သို႔မဟုတ္) အၿပီးတိုင္ ပိတ္ခြင့္ရွိသည္။</h4><h4>အမွားအယြင္း တစ္စံုတစ္ရာ ျဖစ္ေပၚပါက MMWbet Team ၏ ဆံုးျဖတ္ခ်က္သာ အတည္ျဖစ္သည္။</h4>', '<h3 style="text-align: center;">အေကာင့္ စည္းမ်ဥ္းစည္းကမ္း</h3><h4>- mmwbet ဝန္ေဆာင္မူကို ရယူရန္ အေကာင့္ဖြင့္ရန္ လိုအပ္သည္။ (အေကာင့္ဖြင့္ရန္မွာ အခမဲ့ free ျဖစ္သည္။)</h4><h4>- အေကာင့္ဖြင့္ၿပီး တစ္လေက်ာ္သည္အထိ ေငြသြင္း ေငြထုတ္ ႏွင့္ ေဆာ႔ကစားျခင္းမရွိလွ်င္ (သင့္လက္က်န္ေငြမွာ 0 က်ပ္ျဖစ္ေနလွ်င္) MMWbet မွအေကာင့္အား ပိတ္သိမ္းမည္ျဖစ္သည္။<br/></h4><p><br/></p><h3 style="text-align: center;">ေငြသြင္း ၊ ေငြထုတ္ ၊ ေငြလႊဲေျပာင္း စည္းမ်ဥ္းစည္းကမ္း</h3><h4>- သင့္အေကာင့္အတြင္းသို႔ အကန္​႔အသတ္​မရွိ ေငြသြင္းႏိုင္သည္။​</h4><h4>သင္​့ MMWbet အ​ေကာင္​့အတြင္​း​ေငြသြင္းRequest ထည္​့သြင္​းၿပီး MMWbet ၏ ဘဏ္​စာရင္​းသို႔​ ႏွစ္ရက္​​ေက်ာ္​သည္​အထိ မ​ေရာက္​ရွိလွ်င္​ သင္​့​ေငြသြင္​း Request အား MMWbet မွ reject (ပယ္​ဖ်က္​) မည္​ျဖစ္​ပါသည္​</h4><h4>အကယ္​ရ်္​​ေငြသြင္​း Request အား reject (ပယ္​ဖ်က္​)ၿပီးမွ သင္​က MMWbet ဘဏ္​အ​ေကာင္​့သို႔​ေငြသြင္​းၿပီးလွ်င္​ ​ေငြသြင္​းခဲ့သည္​့အခ်က္​အလက္​အတိုင္​း သင္​့ MMWbet အ​ေကာင္​့တြင္​​ေငြသြင္​း Request တြင္​ျဖည္​့သြင္​းၿပီး Request ထပ္​မံ​ေပးပို႔ပါ MMWbet မွသင္​့သြင္​း​ေငြအား confirmed (အတည္​ျပဳ)​ေပးပါမည္​</h4><h4><br/></h4><h4>- သင့္အေကာင့္အတြင္းမွ အကန္​႔အသတ္​မရွိ ေငြထုတ္ႏိုင္သည္။</h4><h4>သင့္ထုတ္ေငြ Request ေပးပို႔ၿပီးသည္ႏွင့္ သင္၏ထုတ္ေငြမ်ားကို MMWbet မွ 24 နာရီအတြင္းလႊဲေပးပါမည္</h4><p><span style="color: inherit;"><br/></span></p><h4><span style="color: inherit;">- သင့္အေကာင့္အတြင္းမွ တျခားအေကာင့္သို႔ ေငြလႊဲေျပာင္းႏိုင္သည္။ တစ္ႀကိမ္လွ်င္ 0 က်ပ္မွ 50,000 က်ပ္​အတြင္းသာ လႊဲေျပာင္းႏိုင္သည္။</span><br/></h4><p><br/></p><h3 style="text-align: center;">ကစားပြဲ စည္းမ်ဥ္းစည္းကမ္း</h3><h4>- တစ္​ႀကိမ္​လွ်င္​ အနည္​းဆံုး 0 က်ပ္​မွ အမ်ားဆံုး 1,000,000 က်ပ္​ထိ အႀကိမ္​​ေရအကန္​႔သတ္​မဲ့ ကစားႏိုင္​သည္​။</h4><p><br/></p>', '<h2 style="text-align: left;"><b style="color: inherit;"><i>Thanks you for using MMWbet service</i></b><br/></h2><p></p><div><b></b><h2 style="text-align: left;"><br/></h2></div><p></p>', '11-17-2016', '11-17-2016', 0, 1);
